    "elot-ell-Grek-Latn-743-2001-ts": {"authority_id":"elot","id":2001,"language":"ell","source_script":"Grek","destination_script":"Latn","name":"ELOT 743:2001","url":"https://docplayer.gr/docview/18/849832/#file=/storage/18/849832/849832.pdf","creation_date":2001,"description":"Reversible transliteration standard, ELOT\n","note":[{"Transcription standard (reversible)":"Clause 3.1, Table 2"}],"tests":[{"source":"Ένα πράμα μόνον με παρακίνησε κι εμένα να γράψω ότι τούτην την πατρίδα την έχομεν όλοι μαζί, και σοφοί κι αμαθείς και πλούσιοι και φτωχοί και πολιτικοί και στρατιωτικοί και οι πλέον μικρότεροι άνθρωποι· όσοι αγωνιστήκαμεν, αναλόγως ο καθείς, έχομεν να ζήσομεν εδώ. Το λοιπόν δουλέψαμεν όλοι μαζί, να την φυλάμεν κι όλοι μαζί και να μην λέγει ούτε ο δυνατός «εγώ» ούτε ο αδύνατος. Ξέρετε πότε να λέγει ο καθείς «εγώ»; Όταν αγωνιστεί μόνος του και φκιάσει ή χαλάσει, να λέγει «εγώ»· όταν όμως αγωνίζονται πολλοί και φκιάνουν, τότε να λένε «εμείς». Είμαστε εις το «εμείς» κι όχι εις το «εγώ». Και εις το εξής να μάθομεν γνώση, αν θέλομεν να φκιάσομεν χωριόν, να ζήσομεν όλοι μαζί.\n\nΓιάννης Μακρυγιάννης.\n","expected":"Éna práma mónon me parakínise ki eména na grápso óti toútin tin patrída tin échomen óloi mazí, kai sofoí ki amatheís kai ploúsioi kai ftochoí kai politikoí kai stratiotikoí kai oi pléon mikróteroi ánthropoi; ósoi agonistíkamen, analógos o katheís, échomen na zísomen edó. To loipón doulépsamen óloi mazí, na tin fylámen ki óloi mazí kai na min légei oúte o dynatós «egó» oúte o adýnatos. Xérete póte na légei o katheís «egó»? Ótan agonisteí mónos tou kai fkiásei í chalásei, na légei «egó»; ótan ómos agonízontai polloí kai fkiánoun, tóte na léne «emeís». Eímaste eis to «emeís» ki óchi eis to «egó». Kai eis to exís na máthomen gnósi, an thélomen na fkiásomen chorión, na zísomen óloi mazí.\n\nGiánnis Makrygiánnis.\n"}],"map":{"character_separator":"","word_separator":" ","inherit":"iso-ell-Grek-Latn-843-1997-t2"}},
  
    "icao-per-Arab-Latn-9303": {"authority_id":"icao","id":9303,"language":"per","source_script":"Arab","destination_script":"Latn","name":"ICAO Doc 9303 Machine Readable Travel Documents Part 3 -- Persian Arabic to Latin","url":"https://www.icao.int/publications/pages/publication.aspx?docnum=9303","creation_date":2015,"description":"Part 3 defines specifications that are common to TD1, TD2 and TD3\nsize machine readable travel documents (MRTDs) including those\nnecessary for global interoperability using visual inspection and\nmachine readable (optical character recognition) means.\n\nSince only Latin-alphabet characters are allowed in the VIZ, if\nmandatory data elements are in a national language that does not use\nthe Latin alphabet, a transcription or transliteration shall also be\nprovided.\n\nThis document defines the transliteration mappings used to produce\nthis transcription or transliteration.\n","tests":null,"map":{"characters":{"'":"","ء":"XE","آ":"XAA","أ":"XAE","ؤ":"U","إ":"I","ئ":"XI","ا":"A","ب":"B","ة":"P","ت":"T","ث":"XTH","ج":"J","ح":"XH","خ":"XKH","د":"D","ذ":"XDH","ر":"R","ز":"Z","س":"S","ش":"XSH","ص":"XSS","ض":"XDZ","ط":"XTT","ظ":"XZZ","ع":"E","غ":"G","ف":"F","ق":"Q","ك":"K","ل":"L","م":"M","ن":"N","ه":"H","و":"W","ى":"XAY","ي":"Y","ً":"F","ٌ":"N","ٍ":"K","َ":"A","ُ":"U","ِ":"I","ْ":"O","ٰ":"","ٱ":"XXA","ٹ":"XXT","ټ":"XRT","پ":"P","ځ":"XKE","څ":"XXH","چ":"XC","ڈ":"XXD","ډ":"XDR","ڑ":"XXR","ړ":"XRR","ږ":"XRX","ژ":"XJ","ښ":"XXS","ک":"XKK","ګ":"XXK","ڭ":"XNG","گ":"XGG","ں":"XNN","ڼ":"XXN","ھ":"XDO","ۀ":"XYH","ہ":"XXG","ۂ":"XGE","ۃ":"XTG","ی":"XYA","ۍ":"XXY","ې":"Y","ے":"XYB","ۓ":"XBE"}}},
  
