    "icao-srp-Cyrl-Latn-9303": {"authority_id":"icao","id":9303,"language":"srp","source_script":"Cyrl","destination_script":"Latn","name":"ICAO Doc 9303 Machine Readable Travel Documents Part 3 -- Serbian Cyrillic to Latin","url":"https://www.icao.int/publications/pages/publication.aspx?docnum=9303","creation_date":2015,"description":"Part 3 defines specifications that are common to TD1, TD2 and TD3\nsize machine readable travel documents (MRTDs) including those\nnecessary for global interoperability using visual inspection and\nmachine readable (optical character recognition) means.\n\nSince only Latin-alphabet characters are allowed in the VIZ, if\nmandatory data elements are in a national language that does not use\nthe Latin alphabet, a transcription or transliteration shall also be\nprovided.\n\nThis document defines the transliteration mappings used to produce\nthis transcription or transliteration.\n","tests":null,"map":{"characters":{"'":"","А":"A","Б":"B","Д":"D","Ё":"E","Е":"E","Э":"E","Ф":"F","Г":"H","И":"I","Й":"I","К":"K","Л":"L","М":"M","Н":"N","О":"O","П":"P","Р":"R","С":"S","Т":"T","У":"U","В":"V","Ы":"Y","З":"Z","Ч":"C","Я":"IA","Ю":"IU","Х":"H","Ш":"S","Щ":"SHCH","Ц":"C","Ж":"Z","Ґ":"G","Ў":"U","Ѫ":"U","Ђ":"D","Ѕ":"DZ","Ј":"J","Љ":"LJ","Њ":"NJ","Һ":"C","Џ":"DZ","Є":"IE","Ї":"I","Ѓ":"G","а":"a","б":"b","д":"d","ё":"e","е":"e","э":"e","ф":"f","г":"h","и":"i","й":"i","к":"k","л":"l","м":"m","н":"n","о":"o","п":"p","р":"r","с":"s","т":"t","у":"","в":"v","ы":"y","з":"z","ч":"c","я":"ia","ю":"i","х":"h","ш":"s","щ":"shch","ц":"c","ж":"z","ґ":"g","ў":"","ѫ":"","ђ":"d","ѕ":"dz","ј":"j","љ":"lj","њ":"nj","һ":"c","џ":"dz","є":"ie","ї":"i","ѓ":"g"}}},
  
