    "icao-rus-Cyrl-Latn-9303": {"authority_id":"icao","id":9303,"language":"rus","source_script":"Cyrl","destination_script":"Latn","name":"ICAO Doc 9303 Machine Readable Travel Documents Part 3 -- Russian Cyrillic to Latin","url":"https://www.icao.int/publications/pages/publication.aspx?docnum=9303","creation_date":2015,"description":"Part 3 defines specifications that are common to TD1, TD2 and TD3\nsize machine readable travel documents (MRTDs) including those\nnecessary for global interoperability using visual inspection and\nmachine readable (optical character recognition) means.\n\nSince only Latin-alphabet characters are allowed in the VIZ, if\nmandatory data elements are in a national language that does not use\nthe Latin alphabet, a transcription or transliteration shall also be\nprovided.\n\nThis document defines the transliteration mappings used to produce\nthis transcription or transliteration.\n","tests":null,"map":{"characters":{"'":"","А":"A","Б":"B","Д":"D","Ё":"E","Е":"E","Э":"E","Ф":"F","Г":"G","И":"I","Й":"I","К":"K","Л":"L","М":"M","Н":"N","О":"O","П":"P","Р":"R","С":"S","Т":"T","У":"U","В":"V","Ы":"Y","З":"Z","Ч":"CH","Я":"IA","Ю":"IU","Х":"KH","Ш":"SH","Щ":"SHCH","Ц":"TS","Ж":"ZH","Ґ":"G","Ў":"U","Ѫ":"U","Ђ":"D","Ѕ":"DZ","Ј":"J","Љ":"LJ","Њ":"NJ","Һ":"C","Џ":"DZ","Є":"IE","Ї":"I","Ѓ":"G","а":"a","б":"b","д":"d","ё":"e","е":"e","э":"e","ф":"f","г":"g","и":"i","й":"i","к":"k","л":"l","м":"m","н":"n","о":"o","п":"p","р":"r","с":"s","т":"t","у":"u","в":"v","ы":"y","з":"z","ч":"ch","я":"ia","ю":"iu","х":"kh","ш":"sh","щ":"shch","ц":"ts","ж":"zh","ґ":"g","ў":"u","ѫ":"u","ђ":"d","ѕ":"dz","ј":"j","љ":"lj","њ":"nj","һ":"c","џ":"dz","є":"ie","ї":"i","ѓ":"g"}}},
  
    "bgnpcgn-kat-Geor-Latn-2009": {"authority_id":"bgnpcgn","id":2009,"language":"kat","source_script":"Geor","destination_script":"Latn","name":"ROMANIZATION OF GEORGIAN; Georgia 2011 national system; BGN/PCGN 2009 Agreement","url":"https://assets.publishing.service.gov.uk/government/uploads/system/uploads/attachment_data/file/810202/ROMANIZATION_OF_GEORGIAN.pdf","creation_date":2009,"confirmation_date":2011,"description":"This romanization system corresponds to that devised in 2002 by the\nState Department of Geodesy and Cartography of Georgia and the\nInstitute of Linguistics of the Georgian Academy of Sciences, and\napproved by Presidential Decree 109 of 24 February 2011. It represents\nthe Mkhedruli alphabet, as presently used in Georgia. This system was\nadopted by BGN and PCGN in 2009, superseding the BGN/PCGN system of\n1981.\n","notes":["This system denotes ejective (glottalised) consonants by means of an apostrophe. The BGN/PCGN 1981 system instead used the apostrophe to denote aspirated consonants (letters 8, 21, 22, 26 & 27).","The Romanization columns show only lowercase forms but, when romanizing, uppercase and lowercase Roman letters as appropriate should be used."],"tests":[{"source":"თბილისი","expected":"tbilisi"},{"source":"მეღვინეთუხუცესი","expected":"meghvinetukhutsesi"},{"source":"ჭიანჭველა","expected":"ch’ianch’vela"},{"source":"ბაყაყი","expected":"baq’aq’i"}],"map":{"inherit":"ggg-kat-Geor-Latn-2002"}},
  
    "alalc-ben-Beng-Latn-2017": {"authority_id":"alalc","id":2017,"language":"ben","source_script":"Beng","destination_script":"Latn","name":"Bengali Romanization, 2017","url":"https://www.loc.gov/catdir/cpso/romanization/bengali.pdf","creation_date":2017,"description":"ALA-LC Romanization table for Bengali\n","notes":["Only the vowel forms that appear at the beginning of a syllable are listed; the forms used for vowels following a consonant can be found in grammars; no distinction between the two is made in transliteration.","The vowel a is implicit after all consonants and consonant clusters\nand is supplied in transliteration, with the following exceptions:\n\na) when another vowel is indicated by its appropriate sign; and\nb) when the absence of any vowel is indicated by the subscript symbol ( ্ )\n  called hasanta or birāma.\n","ব is used both as a labial and as a semivowel. When it occurs as the second or subsequent consonant of a consonant cluster, it is transliterated va. When ব is doubled, it is transliterated bba.","Candrabindu before guttural, palatal, cerebral, and dental occlusives is transliterated n̐. Before labials, sibilants, semivowels, the aspirate, vowels, and in final position it is transliterated m̐.","When doubled, abagraha is transliterated by two apostrophes ( ’’ )."],"tests":[{"source":"র্ক","expected":"rka"},{"source":"গ্র","expected":"gra"},{"source":"ত্য","expected":"tya"}],"map":{"inherit":"un-ben-Beng-Latn-2016","characters":{"অ":"a","ৠ":"ṝ","আ":"ā","ঌ":"ḹ","ই":"I","এ":"e","ঈ":"ī","ঐ":"ai","উ":"u","ও":"o","ঊ":"ū","ঔ":"au","ঋ":"ṛ","ক":"ka","খ":"kha","গ":"ga","ঘ":"gha","ঙ":"ṅa","চ":"ca","ছ":"cha","জ":"ja","ঝ":"jha","ঞ":"ña","ট":"ṭa","ঠ":"ṭha","ড":"ḍa","ড়":"ṛa","ঢ":"ḍha","ঢ়":"ṛha","ণ":"ṇa","ত":"ta","ৎ":"t","থ":"tha","দ":"da","ধ":"dha","ন":"na","প":"pa","ফ":"pha","ব":"ba","ভ":"bha","ম":"ma","য":"ya","য়":"ẏa","র":"ra","ল":"la","শ":"śa","ষ":"sha","স":"sa","হ":"ha"," ং":"ṃ"," ঃ":"ḥ","\\u0981":"n̐","ऽ":"’"}}},
  
